, implementing and deploying RAG-based applications with MLOps.","Technologies used: React Native, ExpressJS, FastAPI, MLflow, Ollama, Gemma, ChromaDB, GitHub Actions, GitHub Codespaces, Amazon EC2"]},{title:"IT Consultant",company:"Liberty Paper Inc., Manila, Philippines",date:"Nov 2023 - Dec 2023",description:["Conducted a comprehensive analysis of existing IT infrastructure and processes to identify enhancement opportunities.","Proposed and strategized the implementation of the following solutions: establishment of a centralized knowledge base for streamlined information access, utilize version control Git and cloud repository GitHub for software development, initiatives for customer service and HR modernization through ServiceDesk, ERP systems modernization using ERPNext for improved operational efficiency, and IT infrastructure upgrade by incorporating VPN and DDNS technologies.","Led the development and execution of the company's strategic plan, aligning business objectives with KPIs to drive growth.","Collaborated with cross-functional teams to ensure alignment between proposed solutions and business objectives.","Technologies used: ERPNext, ServiceDesk, Airtable, Git, GitHub"]},{title:"Software Engineer II",company:"eBay Inc., San Jose, CA",date:"Aug 2021 - Sep 2023",description:["Reduced for mean time to identify root cause related to site impacting changes to advertising platform from 1 minute to 10 seconds.","Continuously delivery of features for experiment metadata enhancement project with team size of 5 to enhance A/B testing monitoring.","Analyze business metrics data inaccuracies, such as revenue clicks, impressions, etc. and work with team members to correct the data.","Involved in batch processing using Spring Batch framework to extract data from ServiceNow and other internal APIs and load into Elasticsearch.","Designed Spring Boot microservices to decouple logic from existing monolithic applications.","Developed and designed table view, search func
